import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './Style/App.css';
import Header from './Header'
import Body from './Body'

function App() {
  return (
    <div className="App">
      <Header/>

      <Router>

        <div className='header__option'>
          <Link to='/'>Add A book</Link>
        </div>

            <div className='header__option'>
              <Link to='/view_books'>View books</Link>
                </div>
              <Switch>
                    <Route path='/'>
                        <Body/>
                    </Route>
                    <Route path='/view_books'>
                        <Test/>
                    </Route>
                </Switch>
            </Router>
    </div>
  );
}

function Test () {
  return (
    <h1>Alooo !</h1>
  )
}

export default App;
